import React from 'react'
import s from './Dialogs.module.css'
import DialogItem from './DialogItem/DialogItem'
import Messages from './DialogItem/Messages'



let dialogsData=[{name: 'Almaz', id: 1},{name: 'Alexey', id: 2},{name: 'Vika', id: 3},{name: 'Tanya', id: 4}]

let messagesData=[{id:1, message: 'Привет, как дела?'},{id:2,message: 'Привет, все хорошо, как твои?'}]

export default function Dialogs() {

    let dialogsElement=dialogsData.map(el=>(<DialogItem name={el.name} id={el.id}/>))
    let messagesElement=messagesData.map(message=>(<Messages message={message.message}/>))
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
               {dialogsElement}
            </div>
            <div className={s.messages}>
              {messagesElement}
            </div>
        </div>
    )
}
